  false,\n\t\"url\": null,\n\t\"notes\": \"A five-letter hydrologic landscape code
  representing five indices of hydrologic form that are related to hydrologic function:
  climate, seasonality, aquifer permeability, terrain, and soil permeability. Each
  hydrologic assessment unit is classified by one of the 81 different five-letter
  codes representing these indices. Polygon features in this dataset were created
  by aggregating (dissolving boundaries between) adjacent, similarly-coded hydrologic
  assessment units. Climate Classes: V-Very wet, W-Wet, M-Moist, D-Dry, S-Semiarid,
  A-Arid. Seasonality Sub-Classes: w-Fall or winter, s-Spring. Aquifer Permeability
  Classes: H-High, L-Low. Terrain Classes: M-Mountain, T-Transitional, F-Flat. Soil
  Permeability Classes: H-High, L-Low.\",\n\t\"license_title\": null,\n\t\"extras\":
